import Card from './card.jsx'

const List = (props) => {
    return(
        <div className="list">
            {props.arrayMatches.map((e, index) => (
                <Card key={index} mascotName={e.mascotName} ownerName={e.ownerName} date={e.date} time={e.time} sintomas={e.sintomas} handleDelete={() => props.handleDelete} />
            ))}
        </div>
    )
}

export default List;
